// src/data/SacredGeometryData.jsx

const SacredGeometryData = [
    {
      name: "Flower of Life",
      description: "A symbol of creation and unity composed of multiple evenly-spaced overlapping circles.",
      geometryType: "2D Pattern",
      uses: ["Meditation Focus", "Energy Grids", "Architecture"],
      image: "/images/sacredgeometry/flower-of-life.jpg",
    },
    {
      name: "Metatron's Cube",
      description: "A sacred geometric figure composed of 13 equal circles and connecting lines. Represents the flow of energy and balance.",
      geometryType: "3D Projection",
      uses: ["Energy Clearing", "Spiritual Protection"],
      image: "/images/sacredgeometry/metatrons-cube.jpg",
    },
    {
      name: "Seed of Life",
      description: "Formed from seven circles, the seed of life represents the 7 days of creation and is foundational to many patterns.",
