      uses: ["Manifestation Rituals", "Sacred Art"],
      image: "/images/sacredgeometry/seed-of-life.jpg",
    },
    {
      name: "Sri Yantra",
      description: "A powerful geometric mandala composed of interlocking triangles representing the cosmos and the human body.",
      geometryType: "Complex Mandala",
      uses: ["Meditation", "Vedic Rituals"],
      image: "/images/sacredgeometry/sri-yantra.jpg",
    },
    {
      name: "Platonic Solids",
      description: "The five fundamental 3D shapes that represent the building blocks of the universe.",
      geometryType: "3D Shapes",
      uses: ["Elemental Healing", "Quantum Resonance Tools"],
      image: "/images/sacredgeometry/platonic-solids.jpg",
    }
  ];

  export default SacredGeometryData;
